      // 3. This function creates an <iframe> (and YouTube player)
      //    after the API code downloads.
      var player;
      function onYouTubeIframeAPIReady()
        {
        player = new YT.Player('player', {
          height: '390',
          width: '640',
          videoId: 'Sa6WLMt-3oQ',
'startSeconds': 5,
               'endSeconds': 60,
          events: {
            'onReady': onPlayerReady,
            'onStateChange': onPlayerStateChange
          }
        });

      }


      var firstTime = 1;
      function onPlayerReady(event)
    {

        if( firstTime == 1 )
        {
              
            event.target.loadVideoById({videoId:"Sa6WLMt-3oQ",
                     startSeconds:12,
                     endSeconds:213,
                     suggestedQuality:"small"});
            firstTime--;

        }


      }

        var skip = 0; //the YT.PlayerState.ENDED event is sent twice between videos and so we need to ignore it once otherwise it plays every second video in the list
        function onPlayerStateChange(event)
        {
            if (event.data == YT.PlayerState.ENDED)
            {
                if ( videos.length != 0 && skip == 0)
                {
                var nextVideo = videos.pop();
                event.target.loadVideoById({
                videoId: nextVideo.vid,
                startSeconds: nextVideo.startSeconds,
                endSeconds: nextVideo.endSeconds
                });
                skip++;
                }
                else
                {

                    skip = 0;

                }

          }
